import React from 'react';
import styled from 'styled-components';

import StoryCardPending from './StoryCardPending';
import Header from '../Header';

const StoryListCon = styled.div`
  display: flex;
  flex-flow: column;
  justify-content: space-evenly;
  background: #ffffff;
  margin: 100px 2%;
  padding: 100px 2%;
`

const StoryListPending = () => {
  const refugees = this.props.refugees.filter(refugee => refugee.approved === false)
    return (
      <div>
        <Header title="Our Stories"/>
        <StoryListCon className="menu-bar" >
          {console.log(refugees, this.props.refugees)}
          {refugees.map(refugee =>  (
              <StoryCardPending 
                key={refugee.name}
                name={refugee.name} 
                age={refugee.age}
                country={refugee.country}
                story={refugee.story}
                imgUrl={refugee.imgUrl} 
              />
            )
          )
          }          
        </StoryListCon>
      </div>

    )
}

export default StoryListPending;
